import React, { useEffect, useState } from "react";
import PocketBase from "pocketbase";
import "./VolumeConverter.css";

const pb = new PocketBase("http://127.0.0.1:8090");
pb.autoCancellation(false);

const SuperscriptFormat = ({ value }) => {
  const [base, exponent] = value.toExponential(2).split("e");
  const cleanExponent = exponent.replace("+", "");
  return (
    <>
      {parseFloat(base).toFixed(2)}×10<sup>{cleanExponent}</sup>
    </>
  );
};

const VolumeConverter = () => {
  const [units, setUnits] = useState([]);
  const [realWorldItems, setRealWorldItems] = useState([]);
  const [categoryId, setCategoryId] = useState("");
  const [inputValue, setInputValue] = useState("");
  const [fromUnitId, setFromUnitId] = useState("");
  const [toUnit1, setToUnit1] = useState("");
  const [toUnit2, setToUnit2] = useState("");
  const [toUnit3, setToUnit3] = useState("");
  const [scientific, setScientific] = useState(false);
  const [real1, setReal1] = useState(null);
  const [real2, setReal2] = useState(null);
  const [real3, setReal3] = useState(null);

  useEffect(() => {
    const fetchCategory = async () => {
      const cats = await pb.collection("categories").getFullList();
      const volume = cats.find((c) => c.name === "Volume");
      if (volume) setCategoryId(volume.id);
    };
    fetchCategory();
  }, []);

  useEffect(() => {
    if (!categoryId) return;

    pb.collection("units")
      .getFullList({ filter: `category = "${categoryId}"` })
      .then(setUnits);

    pb.collection("realworld_items")
      .getFullList({ expand: "unit", filter: `category = "${categoryId}"` })
      .then((items) => {
        const sorted = [...items].sort(
          (a, b) => a.scientific_value - b.scientific_value
        );
        setRealWorldItems(sorted);
        setReal1(sorted[0]);
        setReal2(sorted[1]);
        setReal3(sorted[2]);
      });
  }, [categoryId]);

  const formatValue = (value) => {
    if (!value || isNaN(value)) return "...";
    if (scientific) {
      const [base, exponent] = value.toExponential(2).split("e");
      return (
        <>
          {parseFloat(base).toFixed(2)}×10<sup>{exponent.replace("+", "")}</sup>
        </>
      );
    } else {
      return value.toFixed(6);
    }
  };

  const getConverted = (toUnitId) => {
    if (!inputValue || !fromUnitId || !toUnitId) return "";
    const from = units.find((u) => u.id === fromUnitId);
    const to = units.find((u) => u.id === toUnitId);
    if (!from || !to) return "";
    const result =
      (parseFloat(inputValue) * from.to_base_factor) / to.to_base_factor;
    return formatValue(result);
  };

  const inputInCubicMeter = () => {
    const from = units.find((u) => u.id === fromUnitId);
    return from && inputValue
      ? parseFloat(inputValue) * from.to_base_factor
      : null;
  };

  const RealWorldBox = ({ selected, setSelected }) => {
    const result =
      selected && inputInCubicMeter() && selected.scientific_value
        ? inputInCubicMeter() / selected.scientific_value
        : null;

    return (
      <div className="bg-white shadow border rounded p-4 flex flex-col gap-3">
        <div className="text-xl font-bold text-blue-600 text-center">
          {result ? <SuperscriptFormat value={result} /> : "..."}
        </div>

        <select
          value={selected?.id || ""}
          onChange={(e) => {
            const item = realWorldItems.find((i) => i.id === e.target.value);
            if (item) setSelected(item);
          }}
          className="border p-2 rounded w-full text-sm"
        >
          {realWorldItems.map((item) => (
            <option key={item.id} value={item.id}>
              {item.name}
            </option>
          ))}
        </select>

        {selected && (
          <div className="text-sm text-gray-700 bg-gray-50 rounded p-2 border">
            <div className="font-semibold text-center">{selected.name}</div>
            <div className="flex justify-between text-xs mt-1">
              <span className="text-blue-600">
                <SuperscriptFormat value={selected.scientific_value} />{" "}
                {selected.expand?.unit?.symbol || ""}
              </span>
              <span>{selected.approx_value}</span>
            </div>
            {selected.notes && (
              <div className="text-center text-gray-500 italic mt-2">
                {selected.notes}
              </div>
            )}
          </div>
        )}
      </div>
    );
  };

  return (
    <div className="max-w-6xl mx-auto px-4 py-6 bg-white rounded-lg shadow">
      {/* Toggle */}
      <div className="flex justify-end mb-4">
        <div className="flex items-center border rounded bg-white shadow-sm">
          <button
            className={`px-4 py-1 rounded-l ${
              !scientific ? "bg-blue-600 text-white" : "bg-white"
            }`}
            onClick={() => setScientific(false)}
          >
            Normal
          </button>
          <button
            className={`px-4 py-1 rounded-r ${
              scientific ? "bg-blue-600 text-white" : "bg-white"
            }`}
            onClick={() => setScientific(true)}
          >
            Scientific
          </button>
        </div>
      </div>

      {/* Converter UI */}
      <div className="grid grid-cols-1 md:grid-cols-4 gap-6 items-start">
        {/* Input */}
        <div className="space-y-4 mt-8">
          <h3 className="text-lg font-semibold text-center">From</h3>
          <input
            type="number"
            value={inputValue}
            onChange={(e) => setInputValue(e.target.value)}
            className="border p-2 rounded w-full"
            placeholder="Enter value"
          />
          <select
            value={fromUnitId}
            onChange={(e) => setFromUnitId(e.target.value)}
            className="border p-2 rounded w-full"
          >
            <option value="">-- Select unit --</option>
            {units.map((u) => (
              <option key={u.id} value={u.id}>
                {u.name} ({u.symbol})
              </option>
            ))}
          </select>
        </div>

        {/* Conversions */}
        <div className="md:col-span-3 text-center -mt-6">
          <h2 className="text-2xl font-bold mb-4">Conversion</h2>
          <div className="grid grid-cols-1 sm:grid-cols-3 gap-4">
            {[toUnit1, toUnit2, toUnit3].map((id, index) => {
              const setter =
                index === 0 ? setToUnit1 : index === 1 ? setToUnit2 : setToUnit3;
              return (
                <div key={index} className="border rounded p-4 bg-white shadow-sm">
                  <div className="text-xl font-bold text-blue-600 mb-2">
                    {getConverted(id) || "..."}
                  </div>
                  <select
                    value={id}
                    onChange={(e) => setter(e.target.value)}
                    className="border p-2 rounded w-full text-sm text-center"
                  >
                    <option value="">-- Convert To --</option>
                    {units.map((u) => (
                      <option key={u.id} value={u.id}>
                        {u.name} ({u.symbol}) – {getConverted(u.id)}
                      </option>
                    ))}
                  </select>
                </div>
              );
            })}
          </div>
        </div>
      </div>

      {/* Real World Compare */}
      {inputInCubicMeter() && (
        <div className="mt-10">
          <h3 className="text-lg font-semibold text-center mb-4">
            Compare To Real-World Volumes
          </h3>
          <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
            <RealWorldBox selected={real1} setSelected={setReal1} />
            <RealWorldBox selected={real2} setSelected={setReal2} />
            <RealWorldBox selected={real3} setSelected={setReal3} />
          </div>
        </div>
      )}
    </div>
  );
};

export default VolumeConverter;
